INSERT INTO `v1_fde36e816faee6cdfe0b10172d09829e0dd2cd35231e93589ac74ce55759a25b` VALUES (11, 0.3, 0, 6006, 1, 0, "あたしも教官の仕事を\n頑張れば、あいつに\n喜んでもらえたり\nするのかな…", 0, 8, 6, 129811);
