INSERT INTO `v1_fde36e816faee6cdfe0b10172d09829e0dd2cd35231e93589ac74ce55759a25b` VALUES (11, 0.8, 0, 6011, 1, 0, "マコトさん？\nどうかしましたか？\n何やら不穏な気配を\n感じ取ったのですが", 0, 6, 6, 129911);
