INSERT INTO `v1_fde36e816faee6cdfe0b10172d09829e0dd2cd35231e93589ac74ce55759a25b` VALUES (11, 0.3, 0, 7006, 1, 0, "私の班のみなさんも\n変わらず訓練に励んで\nいるようですわね\n殊勝なことです", 0, 6, 7, 129911);
