INSERT INTO `v1_fde36e816faee6cdfe0b10172d09829e0dd2cd35231e93589ac74ce55759a25b` VALUES (11, 0, 0, 7011, 1, 0, "エリコ班の急成長は\n騎士団の中でも話題に\nなってたからな\nホントすげえ奴等だよ", 0, 6, 7, 129811);
